import React from 'react'
import './PublicHeader.css'
import { withRouter } from 'react-router-dom'
import { Layout, Menu, Breadcrumb } from 'antd';




const { Header, Content, Footer } = Layout;

/**
 * 我们公共的头文件
 */
class PublicHeader extends React.Component{

    render(){

        return (
            <div className="public-header-outer">
               <div style={{float:"left",lineHeight: '64px'}}>
                   <h1>Mr.Zhao Blog</h1>
               </div>
               <Menu
                theme="light"
                mode="horizontal"
                defaultSelectedKeys={['2']}
                style={{ lineHeight: '64px',float:"right",marginRight:"15px" }}
            >
                <Menu.Item key="1" style={{marginRight:"15px"}}>nav 1</Menu.Item>
                <Menu.Item key="2">nav 2</Menu.Item>
                <Menu.Item key="3">nav 3</Menu.Item>
            </Menu>
            </div>
        )
    }
}

export default withRouter(PublicHeader)
